import React, { useEffect }from 'react'
import '../NavigationBar/navigationbar.css'

const NavigationBar = () => {
     
  return (
  <div><button class="navbar-toggler" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasNavbar" aria-controls="offcanvasNavbar" aria-label="Toggle navigation">
  <span class="navbar-toggler-icon"></span>
</button></div>
  )
}

export default NavigationBar
